import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import AlumnoComponent from './components/AlumnoComponent';
import AlumnosComponent from './components/AlumnosComponent';

function App() {
  return (
    <div className="container">
      <Router>
        <Switch>
          <Route path="/new-alumno" component={AlumnoComponent} />
          <Route path="/alumnos" component={AlumnosComponent} />
        </Switch>
      </Router>
    </div>
  );
}

export default App;
